window.bookSummaryJSON = "<p>How did our long-lost ancestors affect our past? More importantly, how will they affect our future? </p> <p>Mark and Julie are brilliant scientists and Major Reagan has kept them and others alive to this point, but the most dangerous confrontations will not be with the Noridians, it will be with the Lower Houses of The Accord. </p> <p><i>Destiny</i> is a thought-provoking journey that will cause you to inspect your basic values. From what it really means to be human to wondering if there's room in the universe for God, it's also a fun listen. </p>"; 
